import { Box } from "@mui/material";
import { ReactElement, useState } from "react";
import { HeaderBox, Logo } from "./style";
import { useNavigate } from "react-router-dom";
import { Input } from "../input/input";
import { Button } from "../button/button";
export const Header = (): ReactElement => {
  const navigate = useNavigate();

  const [isOpen, setIsOpen] = useState("active");
  return (
    <HeaderBox className={isOpen ? "active" : "noActive"}>
      <Box>
        <Input label="gay sex" type="text" placeholder="gay sex"  errors={"monkey"}/>
        <Button
            type="button"
            variant={
              watch("announceType") === "LEILAO"
                ? "brand1_white"
                : "grey5_white"
            }
            size="small"
            onClick={() => setValue("announceType", "LEILAO")}
          >
            Leilão
          </Button>
        {/* <Logo src={} onClick={() => navigate("/")} /> */}
      </Box>
      {/* <NavBar setIsOpen={setIsOpen}/> */}
    </HeaderBox>
  );
};
